// Presale Strategy
// BidenMuskMars Token Presale
// Name: BidenMuskMars Token
// Symbol: BMM$
// Total Supply: 200,000,000,000 (200 Billion)
// Decimals: 9
// No Buy/Sell/Transfer Tax
// No Limit
// No Mintable/Burnable
// Token Price Of Round 1 Presale Duration = $0.0018216 (0.0018216 USDT) 10% Discount
// Round 1 Presale Duration = 31 Days (10/1/2023 - 10/31/2023)
// Token Price Of Round 2 Presale Duration = $0.002024 (0.002024 USDT)
// Round 2 Presale Duration = 11/20/2023 -
contract BidenMuskMarsPresale is Ownable {
    IERC20 public BMM;
    uint256 public TOKEN_PRICE_NUM; // token price numerator in USDT
    uint256 public TOKEN_PRICE_DEN; // token price denominator in USDT
    uint256 public START_TIME;
    uint256 public END_TIME;

    IERC20 public immutable USDT;

    uint256 public totalAmounts;
    uint256 public totalFunds;

    mapping(address => uint256) public userAmounts;
    mapping(address => uint256) public userFunds;

    constructor(
        IERC20 _bmm,
        uint256 _tokenPriceNum,
        uint256 _tokenPriceDen,
        uint256 _startTime,
        uint256 _endTime,
        address _usdt
    ) Ownable(_usdt) {
        BMM = _bmm;
        TOKEN_PRICE_NUM = _tokenPriceNum;
        TOKEN_PRICE_DEN = _tokenPriceDen;
        START_TIME = _startTime;
        END_TIME = _endTime;
        USDT = IERC20(_usdt);
    }

    function buyToken(uint256 amount) external {
        require(block.timestamp >= START_TIME, "START_TIME_UNDER");
        require(block.timestamp <= END_TIME, "END_TIME_OVER");

        uint256 usdtAmount = (amount * TOKEN_PRICE_NUM) / TOKEN_PRICE_DEN;
        userFunds[msg.sender] += usdtAmount;

        require(
            USDT.transferFrom(msg.sender, address(this), usdtAmount),
            "TRANSFER_FROM_FAIL"
        );
        userAmounts[msg.sender] += amount;

        totalFunds += usdtAmount;
        totalAmounts += amount;

        require(BMM.transfer(msg.sender, amount), "TRANSFER_FAIL");
    }

    function SetToken(IERC20 _bmm) external onlyOwner {
        BMM = _bmm;
    }

    function SetTokenPrice(
        uint256 _tokenPriceNum,
        uint256 _tokenPriceDen
    ) external onlyOwner {
        TOKEN_PRICE_NUM = _tokenPriceNum;
        TOKEN_PRICE_DEN = _tokenPriceDen;
    }

    function SetStarTime(uint256 _startTime) external onlyOwner {
        START_TIME = _startTime;
    }

    function SetEndTime(uint256 _endTime) external onlyOwner {
        END_TIME = _endTime;
    }

    receive() external payable {}

    fallback() external payable {}

    function withdrawETH(address to, uint256 amount) external onlyOwner {
        require(block.timestamp > END_TIME, "END_TIME_UNDER");
        uint256 balance = address(this).balance;
        require(balance >= amount, "Insufficient funds for withdrawal");
        payable(to).transfer(amount);
    }

    function withdrawToken(
        IERC20 token,
        address to,
        uint256 amount
    ) external onlyOwner {
        require(block.timestamp > END_TIME, "END_TIME_UNDER");
        uint256 balance = token.balanceOf(address(this));
        require(balance >= amount, "Insufficient funds for withdrawal");
        token.transfer(to, amount);
    }
}
